import React from 'react';
import ros from '../assets/images/ros.png';
function Ros(){
    return(
        <div>
        <h3>ROS turtlesim teleop</h3>
        <img className="link" src={ros} alt="img" />
            <p>ROS work</p>
            </div>
    );
}

export default Ros;
